import React from "react";
import Input from "../components/Input";
import { withTranslation } from "react-i18next";

export default function Login() {
  const { t } = this.props;
  return (
    <form>
      <Input
        name="username"
        label={t("Username")}
        error={"username"}
        onChange={this.onChangeHandler}
      />
      <Input
        name="password"
        label={t("Password")}
        error={"password"}
        type="password"
        onChange={this.onChangeHandler}
      />
    </form>
  );
}
